import styled from "styled-components";

const Call = () => {
    return (
        <CallandMassage>
            <CallBtn />
            <MassageBtn />
        </CallandMassage>
    );
}
export default Call;

const CallandMassage = styled.div`
    background-color: ${(props) => props.theme.color.background};
    display: flex;
    flex-wrap: wrap;
`;
